import React from 'react';
import './App.css';
import AcmHeader from './components/acmheader';
//import MovieList from './components/movielist';
//import Movie from './components/movie';
import Authentication from './components/authentication';
import {HashRouter, Route} from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './stores/store';

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <HashRouter>
          <div>
            <AcmHeader />
            <head>
                <meta charset="utf-8"/>
                <link rel="icon" href="./favicon.png"/>
                <meta name="viewport" content="width=device-width, initial-scale=1"/>
                <link rel="stylesheet" href="/global.css"/>
                <link href="" rel="stylesheet"/>
                <link href="" rel="stylesheet"/>
                <link href="" rel="stylesheet"/>
                <title>ACM at CSUF</title>
            </head>
            <body>
                <header>
                    <span class="svelte">We are the largest</span>
                    <span class="multicolor-text">Computer Science</span>
                    <span class="svelte">community at CU Denver</span>
                </header>
            </body>
            <Route exact path="/signin" render={()=><Authentication />}/>
          </div>
        </HashRouter>
      </Provider>
    </div>
  );
}

export default App;

